Perfekt für einen Start ins Wochenende, dieses Rezept ist einer meiner Favoriten. Chia Samen eignen sich super gut für die extra Portion Omega 3 Fettsäuren und zusätzlich gepackt mit pflanzlichen Proteinen. 

𝐙𝐮𝐭𝐚𝐭𝐞𝐧 
4 Scheiben Dinkel Toast, oder anderes Brot deiner Wahl 
230ml Mandeldrink
1 EL Ahornsyrup
1 EL Chia Samen 
1/4 TL Ingwerpulver 
1/4 TL Muskatnuss 
5g Kokosöl 
𝐓𝐨𝐩𝐩𝐢𝐧𝐠𝐬 
2 EL Kokosjogurt
1 EL Ahornsirup
150g Beeren 

𝐙𝐮𝐛𝐞𝐫𝐞𝐢𝐭𝐮𝐧𝐠 
>In eine Schüssel den Mandeldrink, den Ahornsirup, die Gewürze, Chia Samen, Muskatnuss, Ingwer geben und 5 Minuten aufquellen lassen.
Erhitze eine Pfanne auf mittlerer Stufe und gebe ein wenig Kokosöl hinzu. 
Die Toastscheiben in die Chia Masse eintunken und anschließend Gold braun anbraten. Wiederhole diesen Vorgang mit den anderen 3 Toastscheiben, bis die Chia Samen Masse verbraucht ist. 
Anschließend die Toastscheiben mit Erdbeeren, Kokosjogurt und Ahornsirup servieren. 
